/*==================================================
AllCampusesView.js

The Views component is responsible for rendering web page with data provided by the corresponding Container component.
It constructs a React component to display all campuses.
================================================== */
import React from 'react'; 
import PropTypes from "prop-types";
import { Link } from "react-router-dom";
import './styles/AllCampusesView.css';

const AllCampusesView = (props) => {
  if (!props.allCampuses) {
    return (
      <div className="loading-state">
        <div className="loading-spinner"></div>
        <p>Loading campuses...</p>
      </div>
    );
  }

  return (
    <div className="campuses-container">
      <div className="header-section">
        <div className="title-section">
          <h1>Campus Directory</h1>
          <p className="subtitle">Manage and view all campus locations</p>
        </div>
        <Link to="/newcampus" className="add-button">
          <span>+</span> Add New Campus
        </Link>
      </div>

      {!props.allCampuses.length ? (
        <div className="empty-state">
          <div className="empty-icon">üèõÔ∏è</div>
          <h2>No Campuses Found</h2>
          <p>Get started by adding your first campus to the system.</p>
          <Link to="/newcampus" className="primary-button">
            Add Your First Campus
          </Link>
        </div>
      ) : (
        <div className="campus-grid">
          {props.allCampuses.map((campus) => (
            <div key={campus.id} className="campus-card">
              <div className="campus-image">
                <img 
                  src={campus.imageUrl || 'https://via.placeholder.com/400x200?text=Campus+Image'} 
                  alt={campus.name}
                  onError={(e) => {
                    e.target.src = 'https://via.placeholder.com/400x200?text=Campus+Image';
                  }}
                />
              </div>
              <div className="campus-content">
                <Link to={`/campus/${campus.id}`} className="campus-name">
                  <h2>{campus.name}</h2>
                </Link>
                <div className="campus-details">
                  <p className="campus-address">
                    <span className="icon">üìç</span> {campus.address}
                  </p>
                  {campus.description && (
                    <p className="campus-description">
                      {campus.description.length > 100 
                        ? `${campus.description.substring(0, 100)}...` 
                        : campus.description}
                    </p>
                  )}
                  <div className="student-count">
                    <span className="icon">üë•</span>
                    {campus.students ? campus.students.length : 0} Students
                  </div>
                </div>
                <div className="action-buttons">
                  <Link to={`/campus/${campus.id}`} className="view-button">
                    View Details
                  </Link>
                  <button 
                    className="delete-button"
                    onClick={() => {
                      if (window.confirm('Are you sure you want to delete this campus?')) {
                        props.handleDelete(campus.id);
                      }
                    }}
                  >
                    Delete
                  </button>
                </div>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

AllCampusesView.propTypes = {
  allCampuses: PropTypes.array.isRequired,
  handleDelete: PropTypes.func.isRequired,
};

export default AllCampusesView;
